Step implementation missing for "the url will contains the inventory subdirectoryt".

We tried searching for files containing step definitions using the following search pattern templates:

  - [filepath]/**/*.{js,ts}
  - [filepath].{js,ts}
  - cypress/e2e/step_definitions/*.{js,ts}
  - [filepath]\***.{js,ts}
  - [filepath].{js,ts}
  - cypress\e2e\step_definitions\*.{js,ts}

These templates resolved to the following search patterns:

  - login\**\*.{js,ts}
  - login.{js,ts}
  - cypress\e2e\step_definitions\*.{js,ts}
  - login\***.{js,ts}
  - login.{js,ts}
  - cypress\e2e\step_definitions\*.{js,ts}

These patterns matched the following files:

  - cypress\e2e\step_definitions\login.js
  - cypress\e2e\step_definitions\tags.js
  - cypress\e2e\step_definitions\login.js
  - cypress\e2e\step_definitions\tags.js

However, none of these files contained a step definition matching "the url will contains the inventory subdirectoryt".

You can implement it using the suggestion(s) below.

